import { Api } from './api.js';

export class Datas {
	constructor(url, id) {
		this.url = url;
		this.id = id;
		this.fetchAllUserData = new Api(this.url, this.id);
	}

	getUserDatas() {
		return this.fetchAllUserData.getUserDatas();
	}
}
